import React from "react";

class AddFishForm extends React.Component {
  render() {
    return (
      <form>
      <input price name="price" placeholder="Price"/>
      <input status name="status" placeholder="Status"/>
      <input desc name=" desc" placeholder=" Desc"/>
      <input image name="image" placeholder="Image"/>
      </form>
    )
  }
}

export default AddFishForm;
